import React from 'react';
import {Button} from '@mui/material'
import './login.css'
function Login() {
    return (
        <div className='login-container'>
            <div className='login-body'>
                <h1>Entrar como</h1>
                <div>
                    <Button>Google</Button>
                </div>
            </div>
        </div>
    )
}

export default Login;
